// CartItem.js - Fixed version
import React, { useState } from 'react';
import '../Styles/CartItem.css';

const CartItem = ({ item, onUpdateQuantity, onRemoveItem }) => {
  const [quantity, setQuantity] = useState(item.quantity || 1);
  const [error, setError] = useState('');
  
  // Debug logging
  console.log('CartItem rendered:', {
    id: item.id,
    cart_id: item.cart_id,
    title: item.title
  });

  const handleQuantityChange = (newQuantity) => {
    if (newQuantity < 1 || newQuantity > 10) {
      setError('Quantity must be between 1 and 10');
      return;
    }
    
    setQuantity(newQuantity);
    setError('');
    
    // Use the cart item ID - check all possible ID fields
    const cartItemId = item.id || item.cart_id || item.cartId;
    
    if (onUpdateQuantity && cartItemId) {
      console.log('Updating quantity for cart item:', cartItemId, 'new quantity:', newQuantity);
      onUpdateQuantity(cartItemId, newQuantity);
    } else {
      console.error('Cannot update: cart item ID is undefined', item);
      setError('Failed to update quantity: cart item not found');
    }
  };

  const handleIncrement = () => {
    handleQuantityChange(quantity + 1);
  };

  const handleDecrement = () => {
    if (quantity > 1) {
      handleQuantityChange(quantity - 1);
    }
  };

  const handleRemove = () => {
    // Use the cart item ID - check all possible ID fields
    const cartItemId = item.id || item.cart_id || item.cartId;
    
    if (onRemoveItem && cartItemId) {
      console.log('Removing cart item:', cartItemId);
      onRemoveItem(cartItemId);
    } else {
      console.error('Cannot remove: cart item ID is undefined', item);
      setError('Failed to remove item: cart item not found');
    }
  };

  // Calculate total price
  const totalPrice = ((item.price || 0) * quantity).toFixed(2);
  const unitPrice = (item.price || 0).toFixed(2);

  return (
    <div className="cart-item">
      <div className="item-image">
        <img 
          src={item.image_url || 'https://picsum.photos/120/160'} 
          alt={item.title} 
          onError={(e) => {
            e.target.src = 'https://picsum.photos/120/160';
          }}
        />
      </div>
      
      <div className="item-details">
        <h3 className="item-title">{item.title}</h3>
        <p className="item-author">by {item.author}</p>
        <p className="item-category">{item.genre || 'Fiction'}</p>
        
        <div className="item-rating">
          <span className="rating-stars">{"★".repeat(Math.floor(item.rating || 4))}</span>
          <span className="rating-value">{item.rating || 4.0}</span>
        </div>
        
        <p className="item-pages">{item.pages || 300} pages - {item.published_year || 2023}</p>
        
        {error && (
          <div className="error-message" style={{
            background: '#f8d7da',
            color: '#721c24',
            padding: '8px',
            borderRadius: '4px',
            fontSize: '0.9rem',
            marginTop: '10px',
            borderLeft: '4px solid #dc3545'
          }}>
            {error}
          </div>
        )}
      </div>
      
      <div className="item-quantity">
        <button 
          onClick={handleDecrement}
          className="quantity-btn"
          aria-label="Decrease quantity"
          disabled={quantity <= 1}
        >
          −
        </button>
        
        <input
          type="number"
          min="1"
          max="10"
          value={quantity}
          onChange={(e) => {
            const value = parseInt(e.target.value);
            if (!isNaN(value)) {
              handleQuantityChange(value);
            }
          }}
          className="quantity-input"
        />
        
        <button 
          onClick={handleIncrement}
          className="quantity-btn"
          aria-label="Increase quantity"
          disabled={quantity >= 10}
        >
          +
        </button>
      </div>
      
      <div className="item-price">
        <p className="price">${totalPrice}</p>
        <p className="unit-price">${unitPrice} each</p>
        <button 
          onClick={handleRemove}
          className="remove-btn"
          aria-label="Remove item"
        >
          Remove
        </button>
      </div>
    </div>
  );
};

export default CartItem;
